import { useEffect, useState } from "react";
import React from "react";

function App() {
   const [users, setUsers] = useState([]);
   const [isLoading, setIsLoading] = useState(false);
   const [isError, setError] = useState(false);
   console.log("component rendering");
   useEffect(() => {
      setIsLoading(true);
      setError(false);
      fetch("https://jsonplaceholder.typicode.com/users")
         .then((response) => {
            if (!response.ok) {
               console.log("have another problem", response);
               throw new Error("have another problem");
            }
            return response.json();
         })
         .then((data) => {
            console.log(data);
            setUsers(data);
            setIsLoading(false);
         })
         .catch((error) => {
            console.log(error);
            setIsLoading(false);
            setError(true);
         });
   }, []);
   return (
      <div>
         <p>
            {isError
               ? "Error"
               : isLoading
               ? "Идет загрузка"
               : JSON.stringify(users)}
         </p>
      </div>
   );
}

export default App;
